import React from "react";
import './index.css'

import { NavLink } from "react-router-dom";


const ButtomNav = () =>{

   const Navs = {
       "home":{
           name:"主页",
           path:"/home"
       },
       "shop":{
           name:"shop",
           path:"/shop"
       },
         "service":{
           name:"service",
           path:"/service"
       },
         "mine":{
            name:"我的",
            path:"/mine"
        },

   }
    
 

    return (
    <div className="nav-footer">
      { Object.keys(Navs).map((key)=>{
        return(
           <NavLink key={key} to={Navs[key].path}>{ Navs[key].name }</NavLink>
        )
      })}
    
    </div>)
}

export default ButtomNav
